POU.Declaration:
PROGRAM MAIN_SFC
VAR
	Timer			: TON;
	fbSFC_SamplePOU : FB_SFC_SamplePou;

	eOperation		: E_Operation := eOp_Add;
	iResultC		: DINT;
	bZero			: BOOL;
	bPos			: BOOL;
	bNeg			: BOOL;
	bTest			: BOOL;
	tTimerValue		: TIME := T#3S;
END_VAR

Implementation.ST:
(* FB Call *)
fbSFC_SamplePOU(
	eOperation	:= eOperation,
	iResultC	=> iResultC
);

(* Evaluation *)
IF fbSFC_SamplePOU.iResultC = 0 THEN
	bZero := TRUE;
	bPos := FALSE;
	bNeg := FALSE;
ELSIF fbSFC_SamplePOU.iResultC > 0 THEN
	bZero := FALSE;
	bPos := TRUE;
	bNeg := FALSE;
ELSIF fbSFC_SamplePOU.iResultC < 0 THEN
	bZero := FALSE;
	bPos := FALSE;
	bNeg := TRUE;
END_IF

(* State machine *)
CASE eOperation OF
eOp_Add:
	eOperation := eOp_MUL;
eOp_Sub:
	eOperation := eOp_ADD;
eOp_Mul:
	eOperation := eOp_SUB;
END_CASE
